import React from "react";
import ReactDom from "react-dom";
var jawad1={
  name:"jawad",
  age:22,
}
var {name ,age}=jawad1;
ReactDom.render(
  <React.Fragment>
  <h1>My name is {name}</h1>
  <p>My age is = {age}</p>
  </React.Fragment>
  ,document.getElementById("root")
);
